import { Link, Outlet } from "react-router-dom";
import './Navbar.css'

export default function Navbar() {
    return(
        <div id = 'Navbar'>
            <Link to = ''>Home</Link>
            <Link to = '/Films'>Films</Link>
            <Outlet/>
        </div>
    )
}
